import React, { Component } from "react";
import { NavLink,  withRouter, Link } from "react-router-dom";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authActions";

import "./Sidenav.css";
import logo from "../../images/logo3.png";
import { faHome, faTachometerAlt, faSignOutAlt, faUsers, faDownload, faChartLine} from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

class SideNav extends Component {
  onLogoutClick = e => {
    this.props.logoutUser(this.props.history);
    window.location.href = "/";
  };

 
  render() {
    const { user } = this.props.auth;
    return (
    <div id="sidebar-collapse" className="col-sm-3 col-lg-2 sidebar">
      <div className="profile-sidebar">
       <div className="profile-userpic">
          <img src={logo}  className="img-responsive" alt=""/>
        </div>
        <div className="profile-usertitle">
          <div className="profile-usertitle-name">  <h5 style={{ fontFamily:  "Nexa Light"}}>
                <center><b>Hello Admin,</b> {user.name.split(" ")[0]}</center>
              </h5></div>
              
          <div className="profile-usertitle-status"><span className="indicator label-success"></span>Online</div>
        </div>
        <div className="clear"></div>
      </div>
      <div className="divider"></div>
      {/* <form role="search">
        <div className="form-group">
          <input type="text" className="form-control" placeholder="Search"></input>
        </div>
      </form> */}

      <ul>
          <NavLink exact activeClassName="active-page" to="/dashboard"  style={{color: "#FF9933", fontFamily:  "Nexa Light" }}>
              <FontAwesomeIcon icon={faTachometerAlt} ></FontAwesomeIcon>Dashboard
          </NavLink><br/>
          <NavLink exact activeClassName="active-page" to="/home" style={{color: "#FF9933", fontFamily:"Nexa Light"}}>
             <FontAwesomeIcon icon={faHome}  ></FontAwesomeIcon>Home
          </NavLink><br/>
          <NavLink exact activeClassName="active-page" to="/investor" style={{color: "#FF9933", fontFamily:  "Nexa Light"}}>
             <FontAwesomeIcon icon={faChartLine} ></FontAwesomeIcon>Investor Relation
          </NavLink><br/>
          <NavLink exact activeClassName="active-page" to="/members" style={{color: "#FF9933", fontFamily:  "Nexa Light"}}>
              <FontAwesomeIcon icon={faUsers}  ></FontAwesomeIcon>Members
          </NavLink><br/>
          <NavLink exact activeClassName="active-page" to="/downloadables" style={{color: "#FF9933", fontFamily:  "Nexa Light"}}> 
              <FontAwesomeIcon icon={faDownload} ></FontAwesomeIcon>Downloadables
          </NavLink><br/>
          <Link exact activeClassName="active-page" onClick={this.onLogoutClick} style={{color: "#FF9933", fontFamily:  "Nexa Light"}}> 
              <FontAwesomeIcon icon={faSignOutAlt}  ></FontAwesomeIcon>Logout
          </Link>    
      </ul>
   
	  </div>
    );
  }
}
const mapStateToProps = state => ({
  projects: state.projects,
  auth: state.auth
});

export default withRouter(
  connect(
    mapStateToProps,
    { logoutUser }
  )(withRouter(SideNav))
);
